import logo from './logo.svg';
import './App.css'; 
import { Container } from '@mui/material';



function App() {
  return (
    <div className="App">
      <header className="App-header">


        <img src={logo} className="App-logo" alt="logo" />
      </header>
        <Container><p>WHAT</p></Container>
        <Container><p>THE</p></Container>
        <Container><p>FUCK</p></Container>
    </div>
  );
}

export default App;
